import React from 'react'
import { navigationMenu } from './NavigationMenu'
import { useNavigate } from 'react-router-dom'

const Navigation = () => {
    const navigate = useNavigate();
    return (
        <div className='h-screen sticky top-0'>
            <div classnName="py-5">
                <svg height="20" width="300" xmlns="http://www.w3.org/2000/svg" shape-rendering="geometricPrecision" text-rendering="geometricPrecision" image-rendering="optimizeQuality" fill-rule="evenodd" clip-rule="evenodd"
                    viewBox="0 0 512 462.799"><path fill-rule="nonzero" d="M403.229 0h78.506L310.219 196.04 512 462.799H354.002L230.261 301.007 88.669 462.799h-78.56l183.455-209.683L0 0h161.999l111.856 147.88L403.229 0zm-27.556 415.805h43.505L138.363 44.527h-46.68l283.99 371.278z" /></svg>
                <div className='space-y-6'>
                    {navigationMenu.map((item) => <div className='cursor-pointer flex space-x-3 items-center' onClick={() => item.title === "Profile" ? navigate('/profile/${5}') : navigate(item.path)}>
                        {item.icon}
                        <p className='text-x1'>{item.title}</p> {/* increase size of text */}
                    </div>)}
                </div>
            </div>
        </div>

    )
}

export default Navigation
